import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Salary = () => {
  const [salaryData, setSalaryData] = useState([]);
  const [formData, setFormData] = useState({
    name: '',
    bank: '',
    accountNo: '',
    ifsc: '',
    branch: '',
    daysWorked: '',
    wagePerDay: '',
  });

  // Fetch data on load
  useEffect(() => {
    fetchSalaryData();
  }, []);

  const fetchSalaryData = () => {
    axios.get('/api/salary')
      .then((res) => setSalaryData(res.data))
      .catch((err) => console.error(err));
  };

  // Handle form input
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  // Handle form submit
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const res = await axios.post('/api/salary', formData);
      setSalaryData((prev) => [...prev, res.data]); // append new data
      setFormData({
        name: '',
        bank: '',
        accountNo: '',
        ifsc: '',
        branch: '',
        daysWorked: '',
        wagePerDay: '',
      });
    } catch (err) {
      console.error(err);
      alert('Failed to save');
    }
  };

  return (
    <div className="salary-page">
      <h1>Employee Salary Entry</h1>

      {/* Form */}
      <form onSubmit={handleSubmit}>
        <input name="name" placeholder="Name" value={formData.name} onChange={handleChange} required />
        <input name="bank" placeholder="Bank" value={formData.bank} onChange={handleChange} required />
        <input name="accountNo" placeholder="Account No" value={formData.accountNo} onChange={handleChange} required />
        <input name="ifsc" placeholder="IFSC" value={formData.ifsc} onChange={handleChange} required />
        <input name="branch" placeholder="Branch" value={formData.branch} onChange={handleChange} required />
        <input name="daysWorked" type="number" placeholder="Days Worked" value={formData.daysWorked} onChange={handleChange} required />
        <input name="wagePerDay" type="number" placeholder="Wage/Day" value={formData.wagePerDay} onChange={handleChange} required />
        <button type="submit">Add Salary</button>
      </form>

      {/* Table */}
      <table>
        <thead>
          <tr>
            <th>S.No</th>
            <th>Name</th>
            <th>Bank</th>
            <th>Account No</th>
            <th>IFSC</th>
            <th>Branch</th>
            <th>Days Worked</th>
            <th>Wage/Day</th>
            <th>Total Salary</th>
          </tr>
        </thead>
        <tbody>
          {salaryData.map((item, index) => (
            <tr key={item._id}>
              <td>{index + 1}</td>
              <td>{item.name}</td>
              <td>{item.bank}</td>
              <td>{item.accountNo}</td>
              <td>{item.ifsc}</td>
              <td>{item.branch}</td>
              <td>{item.daysWorked}</td>
              <td>{item.wagePerDay}</td>
              <td>{item.daysWorked * item.wagePerDay}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Salary;
